import React from "react";
import Navbar from "./components/navbar";
import Hero from "./components/hero";
import OurSolutions from "./components/OurSolutions";

function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <OurSolutions />
    </div>
  );
}

export default App;
